import { Component } from '@angular/core';
import { DomSanitizer } from '@angular/platform-browser';
import * as mammoth from 'mammoth';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrl: './app.component.css'
})
export class AppComponent {
  title = 'ngx-doc-viewer-app';

  constructor(private sanitizer: DomSanitizer) { }

  data = [{
    "name": "1-h.docx",
    "data": ""
  },
  {
    "name": "download-Copy (3).docx",
    "data": ""
  }];

  docxFiles = [] as Array<any>;

  ngOnInit() {
    this.loadDocxContent()
  }

  async loadDocxContent() {
    for (let file of this.data) {
      const arrayBuffer = this.base64ToArrayBuffer(file.data);
      const result = await mammoth.convertToHtml({ arrayBuffer });
      const htmlContent = result.value;
      this.docxFiles.push({ content: this.sanitizer.bypassSecurityTrustHtml(htmlContent), name: file.name });
    };
  }

  base64ToArrayBuffer(base64: string): ArrayBuffer {
    const binaryString = window.atob(base64);
    const len = binaryString.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
      bytes[i] = binaryString.charCodeAt(i);
    }
    return bytes.buffer;
  }
}
